schemaDefinition: "create or replace view WW_SURVIVOR_ACCT_NNACV(\n\t\"SurvivorOptyAcctNumber\"\
  ,\n\t\"SurAcctBUNNACV\",\n\t\"OptySalesQuarter\",\n\t\"SurAcctBUNNACVDC\",\n\t\"\
  SurAcctBURenewalACV\"\n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SurvivorOptyAcctNumber\"\
  \ as \"SurvivorOptyAcctNumber\",\n       \"FinNNACV_CC\" as \"SurAcctBUNNACV\",\n\
  \       \"OptySalesQuarter\" as \"OptySalesQuarter\",\n       \"FinNNACVDC_CC\"\
  \ as \"SurAcctBUNNACVDC\",\n       \"RenewalACVAC_CC\" as \"SurAcctBURenewalACV\"\
  \nFROM\n  (SELECT \"SurvivorOptyAcctNumber\" as \"SurvivorOptyAcctNumber\",\n  \
  \        SUM(\"FinNNACV_CC\") as \"FinNNACV_CC\",\n          \"OptySalesQuarter\"\
  \ as \"OptySalesQuarter\",\n          SUM(\"RenewalACV_CC\") as \"RenewalACV_CC\"\
  ,\n          SUM(\"FinNNACVDC_CC\") as \"FinNNACVDC_CC\",\n          SUM(\"RenewalACVAC_CC\"\
  ) as \"RenewalACVAC_CC\"\n   FROM\n     (SELECT \"SurvivorOptyAcctNumber\" as \"\
  SurvivorOptyAcctNumber\",\n             \"FinNNACV_CC\" as \"FinNNACV_CC\",\n  \
  \           \"OptySalesQuarter\" as \"OptySalesQuarter\",\n             \"RenewalACV_CC\"\
  \ as \"RenewalACV_CC\",\n             \"FinNNACVDC_CC\" as \"FinNNACVDC_CC\",\n\
  \             \"RenewalACVAC_CC\" as \"RenewalACVAC_CC\"\n      FROM \"CDL_LS\"\
  .\"PRODUCT_RPT\".\"SURVIVOR_OPP_ACCOUNT\")\"Projection_9\"\n   GROUP BY \"SurvivorOptyAcctNumber\"\
  ,\n            \"OptySalesQuarter\")Aggregation_1;"
